import React from "react";
// import Cards  from "./Cards";
// import Heading from "./Heading";
import "./index.css";

const SlotM=(props)=>{
    let  x =props.x;
     let y =props.y;
       let z =props.z;
       if(x===y && y===z)
       {
        return(
            <>
                <div className="slot_inner">
                    <h1>
                        {x}{y}{z}
                    </h1>
                    <h1>
                        This is matching.
                    </h1>
                    <hr></hr>
                </div>
            </>
        )
       }
       else{
        
        return(
            <>
                <div className="slot_inner">
                    <h1>
                        {x}{y}{z}
                    </h1>
                    <h1>
                        This is not matching.
                    </h1>
                    <hr></hr>
                </div>
            </>
        )
       }
} 


const App=()=>{
    return( <>
   <h1 className="heading"> 🎰 Welcome to {" "}<span style={{fontWeight: "bold"}}>Slot machine Game</span> 🎰 {" "}</h1>
   
<div className="slotmachine">
    <SlotM x='😈' y='😄' z=' 😈'/>
    <SlotM x=' 🌵' y='😄' z=' 😈'/>
 <SlotM x='😈' y=' 😈' z=' 😈'/>
 <SlotM x=' 🍄' y=' 🍄' z=' 🍄'/>
    <SlotM x=' 🐒' y='😄' z=' 🦁'/>
</div>
   
    
    </>)
   
}
export default App;
